// Home.js
import React from "react";
import homeLogo from "./image4.jpg";

const Home = () => {
  return (
    <div>
      <h1>Welcome to the Home Page</h1>
      <img
        src={homeLogo}
        alt="Home Logo"
        style={{ width: "100px", height: "auto", margin: "10px 0" }}
      />
      {/* Add more content as needed */}
    </div>
  );
};

export default Home;
